/**
 * 停止
 */
function stopBGM(fadeSec = 1.0) {
  if (!BGM.audio) return;

  const audio = BGM.audio;
  fadeOut(audio, fadeSec, () => {
    audio.pause();
    audio.currentTime = 0;
  });

  BGM.audio = null;
}

/**
 * フェードイン
 */
function fadeIn(audio, target, sec) {
  clearInterval(BGM.fadeTimer);

  const step = target / (sec * 60);
  BGM.fadeTimer = setInterval(() => {
    audio.volume = Math.min(target, audio.volume + step);
  }, 1000 / 60);
}

/**
 * フェードアウト
 */
function fadeOut(audio, sec, onEnd) {
  clearInterval(BGM.fadeTimer);

  const step = audio.volume / (sec * 60);
  BGM.fadeTimer = setInterval(() => {
    audio.volume = Math.max(0, audio.volume - step);
    if (audio.volume <= 0.01) {
      clearInterval(BGM.fadeTimer);
      onEnd?.();
    }
  }, 1000 / 60);
}

/**
 * ON / OFF
 */
function setBGMEnabled(flag) {
  BGM.enabled = flag;
  if (!flag) stopBGM(0.5);
}

/**
 * 音量変更
 */
function setBGMVolume(v) {
  BGM.volume = Math.max(0, Math.min(1, v));
  if (BGM.audio) BGM.audio.volume = BGM.volume;
}

function loadBGMbase64(vol, b64) {
  const audio = new Audio("data:audio/mp3;base64," + b64);
  audio.preload = "auto";
  BGM.audio = audio;
  BGM.volume = vol;
  BGM.enabled = true;
}

loadBGMbase64(0.1, "");
